import './header.css';

const Header = () => {
    return ( <div className='header'>
        <div className='logo text'>Events.by</div>
        <div className='sign'>
            <button className='login text'>
                Log in
            </button>
            <button className='logout text'>
                Log out
            </button>
            </div>
    </div> );
}

export default Header;
